script: |
  super -f text -I q5986.spq | sort > q5986.out

inputs:
  - name: q5986.spq
    data: |
      SELECT + 85 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 NOT IN ( - col1, CAST ( 86 AS INTEGER ), - - ( - col2 ), - col2 );
  - name: tab2

outputs:
  - name: q5986.out
    data: |
      85
      85
      85
